   _parent.攻击时移动(_parent._parent.跑X速度 * 2,_parent._parent.跑X速度 * 2);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{//Key.isDown(_parent._parent.A键)更换为_parent._parent.动作A
		/*
		if (_parent._parent.被动技能.上挑 && _parent._parent.被动技能.上挑.启用 && _parent._parent.动作A && _parent._parent.动作B)
		{
		_parent._parent.状态改变("兵器跳");
		}
		*/
		if (_parent._parent.被动技能.拳脚空中连招 && _parent._parent.被动技能.拳脚空中连招.启用 )
		{
			if(Key.isDown(_parent._parent.A键)){
				if(_parent.不按攻击){
					_parent.gotoAndPlay("旋风腿");
				}
			}else{
				_parent.不按攻击 = true;
			}
		}


		if (!_parent._parent.飞行浮空 && _parent._parent.动作B)
		{
			_parent._parent.状态改变("空手跳");
		}


	}
}

onClipEvent (load) {
	_parent.当前初始帧 = _parent._currentframe;
	_parent.蓄力 = 0;
	if (_parent._parent.火箭重拳 && _parent._parent.火箭重拳许可 && _parent._currentframe == _parent.当前初始帧 && Key.isDown(_parent._parent.A键))
	{
		_parent._parent.火箭重拳蓄力中 = true;
		_parent.stop();
	}
	this.onUnload = function()
	{
		_parent._parent.火箭重拳蓄力中 = false;
		_parent.play();
	};
}
onClipEvent (enterFrame) {
	if (_parent._parent.火箭重拳 && _parent._parent.火箭重拳许可 && Key.isDown(_parent._parent.A键) && _parent._currentframe == _parent.当前初始帧 && _parent.蓄力 < 45)
	{
		_parent.stop();
		_parent._parent.火箭重拳蓄力中 = true;
		_parent.蓄力 += 1;
	}
	else
	{
		_parent._parent.火箭重拳蓄力中 = false;
		_parent.play();
	}
	if (_parent._parent.左行)
	{
		_parent._parent.右行 = 0;
		_parent._parent.方向改变("左");
	}
	else if (_parent._parent.右行)
	{
		_parent._parent.左行 = 0;
		_parent._parent.方向改变("右");
	}
}
