onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 1;
	if (_parent._parent.被动技能.拳脚攻击 && _parent._parent.被动技能.拳脚攻击.启用)
	{
		子弹属性.子弹威力 *= 1 + _parent._parent.被动技能.拳脚攻击.等级 * 0.1;
	}
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 0.1;

	子弹属性.水平击退速度 = 16;
	子弹属性.垂直击退速度 = 8;
	子弹属性.暴击 = function(当前子弹)
				{
					return _root.随机浮点(1,2);
				};
	子弹属性.击中后子弹的效果 = "斩打命中特效";
	//非常用
	/*
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
