	子弹属性.暴击 = function(当前子弹)
				{
					return _root.随机浮点(1,5);
				};
	子弹属性.击中后子弹的效果 = "斩打命中特效";
	//非常用
	/*
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(enterFrame){
   _parent.攻击时移动(_parent._parent.跑X速度 * 2.5,_parent._parent.跑X速度 * 2.5);
}

onClipEvent(enterFrame){
	var 速度倍率 = 2;
	if(_parent.蓄力){
		速度倍率 += _parent.蓄力 / 25 ;
	}
   _parent.攻击时移动(_parent._parent.跑X速度 * 速度倍率,_parent._parent.跑X速度 * 速度倍率);
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{
		_parent.空手攻击搓招();
	}
	_parent.变招判定("腕刃5连招");
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{//Key.isDown(_parent._parent.A键)更换为_parent._parent.动作A
		/*
		if (_parent._parent.被动技能.上挑 && _parent._parent.被动技能.上挑.启用 && _parent._parent.动作A && _parent._parent.动作B)
		{
		_parent._parent.状态改变("兵器跳");
		}
		*/
		if (_parent._parent.被动技能.拳脚空中连招 && _parent._parent.被动技能.拳脚空中连招.启用)
		{
			if(Key.isDown(_parent._parent.A键)){
				if(_parent.不按攻击){
					_parent.gotoAndPlay("旋风腿");
				}
			}else{
				_parent.不按攻击 = true;
			}
		}


		if (!_parent._parent.飞行浮空 && _parent._parent.动作B)
		{
			_parent._parent.状态改变("空手跳");
		}


	}
}

onClipEvent (enterFrame) {
	if(_parent.蓄力 && _parent.蓄力>=20 && _parent.抓取){
		_parent.持续抓取();
	}
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
